import './index.css';
function Left(props) {
    const { addNote } = props;
    return (
        <div className="Left">
            <div className="LeftTop">
                <h1>Notes</h1>
                <button onClick = {addNote}>+</button>
            </div>
            < div className="LeftBot">
                <p>No Note Yet</p>
                </div>
        </div>
    );
}

export default Left;
